const Main = (props) => {
    let moviesData=props.data
    let handle=props.handle
    return ( 
        <div className="main">
            {moviesData.map((data)=>(
                <div className="info">
           <h1>{data.Title}</h1>
            <p>{data.Genre}</p>
            <p>{data.Rated}</p>
            <p>{data.Director}</p>
            <p>{data.Plot}</p>
            <p>{data.imdbID}</p>
            <div className="btn">
            <button onClick={()=>handle(handle.imdbID)}>Remove</button> 
            </div>
            </div>
            ))}
            
            </div>
            
     );
}
 
export default Main;
